import React, { Component } from "react";
import "./App.css";
import MovieList from "./components/MovieList";

class App extends Component {
  movies = ["titanic", "hgjk"];
  componentDidMount() {
    fetch("https://127.0.0.1:8000/api/movies/");
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Movie Rater</h1>
          <MovieList movies={this.movies} />
        </header>
      </div>
    );
  }
}

export default App;
